import React from 'react';

import { Container, ContactTitle, SectionContact, Input, WrapperInput, Textarea, SubmitButton } from './styles';

export function About() {
  return(
      <Container>
        <ContactTitle>Contato</ContactTitle>


        <SectionContact>
          <form>  
            <WrapperInput>
              <Input type="text"  required placeholder="Nome"/>
              <Input type="email" required  placeholder="Email"/>
            </WrapperInput>
            <Textarea placeholder="Escreva" rows="10" cols="50"></Textarea>

          </form>
        </SectionContact>
      </Container>
  );
}
